    false,nt"url": null,nt"notes": "This report will serve as a baseline from
    which to evaluate in the long term the effectiveness of the refuge efforts to maintain
    grass-dominated fields (by any method) using the distribution and density of grasshopper
    sparrows during the breeding season as a measure.  This report reflects point count
    survey work that was conducted through the years 2007 -2009, and a follow up survey
    in 2010 that included territory mapping of the grasshopper sparrow with associated
    vegetation characterization. It focuses on grasshopper sparrow (a focal species),
    eastern meadowlark, dickcissel and northern bobwhite.",nt"license_title": "License
